(120, 'NANDAN KUMAR JHA', 'nandanjha922@gmail.com', '7761943999', 'Ph.D Scholar-SRF', 'Assistant Professor-Mechanical Engineering', '\r\nDear Sir/Madam,\r\n \r\nI am writing to apply for the position of Assistant Professor in Mechanical Engineering Department at MIT Group of Institutes, Ujjain. I am currently doing my full-time Ph.D from IIT (ISM) Dhanbad and about to complete my Ph.D pre-submission requirements by December 2019. I am about to defend my Ph.D dissertation within three months. My Ph.D dissertation is based on a DRDO project to ‘design and test the acoustic damping characteristics of jet engine screech liners’. During my Ph.D, I have also served as a teaching assistant and assisted my professors in various academic activities. \r\n \r\nI am highly interested to contribute as a faculty in academic activities and also focus on my research areas as well as on other professional activities. The academic training and research experiences during this period have built my confidence and my interest in teaching as well as in research, and I look forward to provide my services as a faculty, if I get an opportunity at your college.\r\n \r\nI am enclosing my resume and kindly let me know if any further information is needed.\r\n \r\nThank you very much for your attention and consideration.\r\n \r\nSincerely,\r\n \r\nNandan Kumar Jha     \r\nPh.D. Scholar\r\nDepartment of Mechanical Engineering\r\nIndian Institute of Technology (ISM) Dhanbad\r\nContact: - +91-7761943999, 7079094231\r\nEmail: - nandanjha922@gmail.com\r\nOrcid-Id: - 0000-0002-7944-8486  \r\n', '*I have working knowledge of the softwares; AutoCAD, Solidworks, COMSOL Multiphysics, ANSYS Fluent, ANSYS Harmonics, MATLAB, Abaqus, EDEM, LabVIEW, Tecplot, and Origin.\r\n*I have served as Teaching Assistant during Ph.D.\r\n', 'CareerResume/b67f5e85-e989-4fbc-9eb9-357b687b9ecb.pdf', '2019-12-11'),
