(367, 'ANKUR JAUHARI', 'lifecoach.jauhari@gmail.com', '8799262626', 'Executive Director, GGES Education Group', 'Senior Administrator', 'Sir,\r\nI would like to apply for the Senior Administrator position with your esteemed organization. I hold nearly 22 years of total experience, of which 17 years are in the education field, with eight of those spent as a senior administrator. In my current capacity as Executive Director with the GGES Education Group, I lead a team of nearly 200 individuals, including both teaching and non-teaching personnel.\r\n\r\nMy academic preparation and excellent organizational skills aid in my ability to be a successful administrator. I possess strong leadership skills that help me to interact well with faculty, students, parents, and other key stakeholders. My professional experience over the years has taught me the benefits of good communication. I have been praised for my efforts to keep all team members informed of the important duties required of them. I would love to bring this collaborative spirit to your esteemed organizations. I am sure that my education, leadership skills, and personal qualities make me a great candidate for the position of senior administrator at your organization.\r\n\r\nI am prepared to move to a new location and take on new responsibilities.\r\n\r\nI\'m looking forward to meeting you in person so we can talk about my overall qualifications and go over my portfolio. Please don’t hesitate to contact me at your earliest convenience, and I thank you for your consideration.\r\n\r\nSincerely,\r\nProf. Ankur Jauhari', 'Handle and head four institutes, viz., Kanpur Institute of Management Studies, Great Ganges Institute of Technology, Mount Litera Zee School, and Zee College of Pharmacy.\r\nIdentify the student population\'s success needs and implement and monitor academic and literacy programmes to meet those needs.\r\nDesign and implement student behavioural modification programmes to reduce truancy, attitude, and interactions with teachers and peer students.\r\nSuccessfully develop and maintain an atmosphere of openness, confidentiality, and trust between and among all stakeholders: students, guardians, and teachers.\r\nCollaborate with the executive team to choose programming strategies for student academic improvement based on assessment data screens, interviews, and recommendations for instructional and non-instructional personnel for employment.\r\nObserve teaching methods and examine learning materials to evaluate and standardise curricula and teaching techniques, and to determine areas where improvement is needed.\r\nConduct informative monthly staff meetings and trainings to ensure that up-to-date best practises and curriculum are being used.\r\nMotivate the teachers to pursue research and undertake major and minor projects funded by various government bodies.\r\nMaintaining strong relationships with the Parents, local administration, concerned government authorities, and regulatory bodies.\r\nResolve conflicts and other issues.\r\nEnsure the school complies with relevant laws and regulations.\r\nReview and implement the course\'s fees, admission, and marketing policies.\r\nDeveloping the policies in such a way that they are optimally suited to both the working environment and the staff members\r\nHelp shape and uphold the vision of the organization.\r\nTake care of the campus expansion and renovations as and when required.\r\nGuide and supervise all the directors and principals in the smooth functioning of their respective institutions.\r\nMaintain a close eye on IQAC to make sure that quality assurance and best practices are being followed. \r\n\r\n', 'CareerResume/45e32dfd-08e4-4105-96f0-fa969c8173b4.pdf', '2023-02-27'),
