(386, 'Neha Sharma', 'torneshwarisharma@gmail.com', '7879476432', 'Assistant Professor', 'Assistant Professor in Management', 'Hello , \r\n\r\nI am Neha Sharma residing in indore. I am working as an Assistant Professor in CDGI Indore . I had  worked  as an Assistant Professor in Oriental University Indore for 1 Year . I had completed my MBA from Oriental University Indore in HR & Marketing. I have taught Odd and Even Semesters of MBA , BBA , BSC(CS )and BBA LLB . I had taught them Core subjects and specialization as well in MBA Final Year. I will apply for a PHD as well in the upcoming session .\r\nI was Faculty Coordinator of Alumni Association from the Management Department. I had worked as Faculty Coordinator of the Sponsorship Committee in ` Atharva 2K22 `.\r\nI have 6 months industry experience as well in HR from wellspring healthcare private limited Navi Mumbai.\r\nI had worked as an HR trainer from Universal Informatics Indore. I want to apply for Assistant Professor in the Management Department  at your Institute. If you have any vacancy for the same please let me know.\r\nHere I am attaching my resume for your reference.\r\n\r\nThanks & Regards\r\nMs . Neha Sharma', 'Lecturer , Communication , Management ', 'CareerResume/1412241d-3a07-41c4-b2b8-0b2904c442f8.docx', '2023-04-11'),
