(389, 'Anit Shah', 'meanitshah@gmail.com', '9131436486', 'Office Assistant ', 'Office Assistant ', 'Quick Learner and Punctual.\r\n❖ Helping nature and self –motivated.\r\n❖ Hard Working with full dedication and strong power of expression.\r\n❖ Proactive Attitude towards any assignment and self –Learning ability', 'I am involved in the scholarship department and student section, and I know the work of MPTAAS and MP portal \r\n2.0. I am able to complete all the work related to scholarship. And I have experience in manual software testing \r\nand industrial (Shift Engineer).', 'CareerResume/fca912ec-30c2-4503-bd3d-90bf9ca60a0b.pdf', '2023-04-17'),
(390, 'Sanjay Gautam', 'sanjay.mitsgwl@gmail.com', '9425334708', 'Assistant Professor ', 'Assistant Professor ', 'It is  goof for me if i will mid a chance to work under your guidance in  MIT Group of Institute.', '1. I have also worked as  Examination Controller and in Training Placement Head.\r\n2. I have also guided M.Tech students in their Project Work.\r\n3. I have also made a chance as member to work in BOS meeting.\r\n', 'CareerResume/96e8f884-268d-4982-bd93-f1fbe633706e.pdf', '2023-04-18'),
