(392, 'Upama Vyas', 'uvys.res@gmail.com', '8962758790', 'Freelancer', 'Assistant Professor (CSE and/or IT)', 'To, \r\nThe Recruitment Manager,\r\nMIT Ujjain, MP\r\n\r\nRespected Madam/Sir,\r\n\r\nI am Upama Vyas based in Bhopal. I have worked as Assistant Professor (for about 11 years) at various Government and Private Engineering institutes of good repute. My last teaching appointment was in TEQIP-III project and under this project I worked in Government Engineering College Jhalawar and University College of Engineering and Technology, Vinoba Bhave University, Hazaribag from Jan. 2018 - May, 2022.\r\n\r\nI am also active in research and worked at some of the prestigious organizations like IIT Indore and Council of Scientific and Industrial Research (CSIR).\r\n\r\nMy last research appointment was at CSIR\'s Innovation Protection Unit (June 2022 - January 2023), where I got exposure to Intellectual Property Rights (IPR). During my tenure in CSIR, my work was focused on Patents. My contributions include: Patent Searching, Drafting and Filing the patent applications to IPO and handling the patent prosecution with Indian as well as Foreign patent offices (including US, Europe, etc).\r\n\r\nSince managing IPR is an important skill in academics too. After getting the exposure in the IPR domain, I again want to get back to academics.\r\n\r\nFurther details about my academic qualifications and work experience are mentioned in the CV attached herewith.\r\n\r\nKindly consider this as my formal application for the Faculty Position in the department of Computer Science and Engineering at your prestigious University.\r\n\r\nI look forward to hearing from you in this regard.\r\n\r\nBest regards,\r\nUpama Vyas', 'Teaching, Research, Research Grant writing, Academic, technical and professional writing, Mentoring students\' research and application based projects, Curriculum development, Documenting, report writing, presentations, Initiating and managing collaboration with industry and academia for the benefit of institute and students, etc. ', 'CareerResume/05477339-4431-4dd3-be15-ae7f1b15d7c3.pdf', '2023-05-11');
