(15, 'Webinar “Role of Big Data in Smart Cities', 'Date April 30-2020  Time: 05 pm Onwards\r\nResource person Dr. Pranjal Muley\r\nAssociate- Dean IT\r\nInstitute of Management & Research\r\nVivekanand Education Society, Mumbai\r\n', '18', 'MIT News, Ujjain', '64a5032e8884c.jpg', 'Admin', '2020-04-30', 'Webinar “Role of Big Data in Smart Cities', 'Webinar “Role of Big Data in Smart Cities', 'Webinar “Role of Big Data in Smart Cities', '2023-06-21 17:06:58'),
(16, ' ICICI conducted a campus drive in MIT group', 'Ujjain: The campus drive of ICICI Prudential Life Insurance was conducted at Institute of MIT at the Institute of MIT Group of Institutes. Giving this information, MIT Group\'s training and placement deputy director Prof. Anurag Bhadania said that the students of 2019 studying in the last year of Computer Science, IT, Civil, Mechanical, EC, EX, MBA Branch and MCA courses participated in the campus drive. In the first phase of Campus Drive, HR manager Ravnita Dhankar gave detailed information about the company\'s profile and organized a group discussion and interview in the second phase. On this occasion, the placement director Dr. Vivek Bansod, Prof. Navneet Tiwari, Prof. Vishal Gupta and all the teachers were present. The above information is given by PRO. Mushtaq Patel', '12', 'MIT News, Ujjain', '64a5033f55d5c.jpg', 'Admin', '2019-03-11', 'Ujjain: The campus drive of ICICI Prudential Life Insurance was conducted at Institute of MIT at the', 'MIT Ujjain, MIT Campus, MIT ICICI', ' The campus drive of ICICI Prudential Life Insurance was conducted at Institute of MIT at the Institute of MIT Group of Institutes. Giving this information, MIT Group\'s training and placement deputy director Prof. Anurag Bhadania said that the students of 2019 studying in the last year of Computer Science, IT, Civil, Mechanical, EC, EX, MBA Branch and MCA courses participated in the campus drive. ', '2023-06-21 17:12:34'),
(17, ' Annual Function', 'Ujjain: In the year 2019 the students of the MIT group of institutes introduced their talents in various cultural competitions. In the Yearly Cultural Event , competitions like Mehandi, Rangoli, Instant Speech Competition, Group Discussion, Poster, Mending, Best Out West, Instant Dish, Salad Sajana, Antakkshari etc. were organized.\r\nStudents of the institute, shown their art in the Rangoli and had a fantastic time in music competition event. Shri Rajendra Chavda, Shri Pankaj Acharya, Virendra J. and Vice Chairman of Institute Mr. Aditya Vashistha, Dr. Vivek Bansode, V. M. Shah was presented. \r\nMr. Acharya addressed the students and said that the activities of cultural and sports are necessary for the overall development of the students, necessary to increase self confidence. Shri Chavda encourages students\' morale. Prof. Ponday Pandey, Prof. Shailendra Kumar Verma, Dr. Santosh Vyas, Prof. Manish Soni, Dr. Shweta Naik, Dr. Minal Rathore, were also presented. The above information was given by PRO Mushtaq Patel.', '12', 'MIT News, Ujjain', '64a50350b5d1d.jpg', 'Admin', '2019-02-11', 'Annual Function', 'Annual Function MIT, MIT Ujjain', 'In the year 2019 the students of the MIT group of institutes introduced their talents in various cultural competitions. In the Yearly Cultural Event , competitions like Mehandi, Rangoli, Instant Speech Competition, Group Discussion, Poster, Mending, Best Out West, Instant Dish, Salad Sajana, Antakkshari etc. were organized.', '2023-06-21 17:17:37'),
(18, 'Sports week of MITM is started', 'Ujjain: : Annual Sports  Week started in the MITM institute of MIT Group of Institutes, various games like  football, leg cricket, cricket, chase, badminton, table tennis, Kho-kho, etc will be played during this event. On this occasion, institute Director Dr. JN Visas, Vice President Shri Aditya Vashistha was presented as the chief guest. In his remarks, Shri Vashishth said that in order to encourage the students to strengthen the team spirit, and participating actively in sports, considering the refinement of their individual and regardless of the loss or victory, students was encouraged to participate in games. The sports secretary of the student union, Mr Abhishek Chattewadi introduced the guests. On this occasion Pro. Vishal Gupta, Mr. Usman Khan was present. The above information is given by PRO. Mushtaq Patel.', '11', 'MIT News, Ujjain', '64a5036eb6465.jpg', 'Admin', '2019-01-09', 'Sports week of MITM is started', 'MIT Sports, MIT Ujjain, MITM, Sports Week', 'Annual Sports  Week started in the MITM institute of MIT Group of Institutes, various games like  football, leg cricket, cricket, chase, badminton, table tennis, Kho-kho, etc will be played during this event. ', '2023-06-21 17:21:04'),
(19, 'Annual Sports  Week started ', 'Ujjain: : Annual Sports  Week started in the MITM institute of MIT Group of Institutes, various games like  football, leg cricket, cricket, chase, badminton, table tennis, Kho-kho, etc will be played during this event. On this occasion, institute Director Dr. JN Visas, Vice President Shri Aditya Vashistha was presented as the chief guest. In his remarks, Shri Vashishth said that in order to encourage the students to strengthen the team spirit, and participating actively in sports, considering the refinement of their individual and regardless of the loss or victory, students was encouraged to participate in games. The sports secretary of the student union, Mr Abhishek Chattewadi introduced the guests. On this occasion Pro. Vishal Gupta, Mr. Usman Khan was present. The above information is given by PRO. Mushtaq Patel.', '12', 'MIT News, Ujjain', '64a503813fa5e.jpg', 'Admin', '2019-01-01', 'Annual Sports  Week started ', 'MIT Annual Sports, Sports Week, MIT Ujjain', ' Annual Sports  Week started in the MITM institute of MIT Group of Institutes, various games like  football, leg cricket, cricket, chase, badminton, table tennis, Kho-kho, etc will be played during this event. ', '2023-06-21 17:24:45'),
(20, 'Professor verma of civil department MIT is invited by Indian institute of science, Bangalore', 'Ujjain: Head of Civil Department,  MIT Group of Institutes,Prof. Shailendra Kumar Verma has been selected under the \"Short Term Course\" of \"Modeling and Analyzing Sustainable Transport for Scientific Dissolution Support\" organized by Indian Institute of Science (Bangalore) from 17.12.2018 to 21.12.2018. \'\'. The above information is given by PRO. Mushtaq Patel.', '12', 'MIT News, Ujjain', '64a50397e90ac.jpg', 'Admin', '2018-12-17', 'Professor verma of civil department MIT is invited by Indian institute of science, Bangalore', 'civil department MIT, MIT Ujjain', 'Head of Civil Department,  MIT Group of Institutes,Prof. Shailendra Kumar Verma has been selected under the \"Short Term Course\" of \"Modeling and Analyzing Sustainable Transport for Scientific Dissolution Support\" organized by Indian Institute of Science (Bangalore) from 17.12.2018 to 21.12.2018.', '2023-06-21 17:28:13'),
(21, ' Dr Vyas and Professor pipaniya of MIT will present their research papers in IIT Bombay', 'Ujjain:  Dr. Santosh Vyas and Prof. Shailendra Pappania, Mechanical Department, MIT Group of Institutes, will be presenting the Research papers on Subject Semi tube technology on 10.12.2018 and 12.12.2018 under the International Conference on \"National Society of Flood Mechanics and Fluid Power\" in IIT Bombay. This research paper was prepared under the guidance of Dr. Sunil Punjabi of Ujjain Engineering College. The above information is given by PRO. Mushtaq Patel.', '12', 'MIT News, Ujjain', '64a503aab177f.jpg', 'Admin', '2018-12-10', 'Dr Vyas and Professor pipaniya of MIT will present their research papers in IIT Bombay', 'MIT Ujjain', 'Dr. Santosh Vyas and Prof. Shailendra Pappania, Mechanical Department, MIT Group of Institutes, will be presenting the Research papers on Subject Semi tube technology on 10.12.2018 and 12.12.2018 under the International Conference on \"National Society of Flood Mechanics and Fluid Power\" in IIT Bombay. ', '2023-06-21 17:31:18'),
(22, 'TCS conducted faculty development program in MIT group ', 'Ujjain: In the MIT Group of Institutions, the country\'s well-known software company TCS has organize', '12', 'MIT News, Ujjain', '64a51d77467df.jpg', 'Admin', '2018-11-14', 'TCS conducted faculty development program in MIT group', 'MIT Group, MIT Ujjain, TCS, FDP', 'In the MIT Group of Institutions, the country\'s well-known software company TCS has organized a one-day Factal Development Program (FDP) for the teachers of Computer Science and IT branch. Under this program, Mr. Gaurav Bhalani, TCS Academic Relationship Officer, apprised all the teachers about the new technology. ', '2023-07-05 13:06:23'),
(23, 'MIPS successfully conducted blood donation camp ', 'Ujjain: Blood donation camp was conducted with the help of HDFC Bank and District Hospital Ujjain at\r\n', '16', 'MIT News, Ujjain', '64a51e42b8a9c.jpg', 'Admin', '2018-10-15', 'MIPS successfully conducted blood donation camp', 'MIT Ujjain, Blood Camp, MIPS', 'Blood donation camp was conducted with the help of HDFC Bank and District Hospital Ujjain at MIPS, MIT Group of Institutes. District Magistrate Ujjain on the launch SN Wilwre inspired the students for voluntary blood donation. ', '2023-07-05 13:09:46');
