(9, 'MIT Placement | Ceorra', 'Congratulations!! Mayur Choudhary, Mayank Joshi, Sagar Vyas, Shivam Swami\r\n Sattam Sugandhi,Yash Shukla, Subodh Mogra for receiving placement offer from Ceorra  \r\nduring the Campus Drive held at MIT Group.\r\nKeep aiming higher! The sky is the limit!', 'MIT Placement | Ceorra', 'ImagePlacementNews/a715b6da-e339-4ebd-ba61-39130671d3cf.jpg', 'Admin', '2019-01-16 00:00:00', 'MIT Placement | Ceorra', 'MIT Placement, Ceorra, MIT Ujjain', 'Congratulations!! Mayur Choudhary, Mayank Joshi, Sagar Vyas, Shivam Swami\r\n Sattam Sugandhi,Yash Shukla, Subodh Mogra for receiving placement offer from Ceorra  '),
(10, 'MIT Placement | ICICI Prudential', 'Congratulations!! Aanchal kakkar, Ayushi Bhardwaj, Abhishek Sharma, Sankalp Bairagi\r\nMohit Rathore, Kishkindha Patankar, Hemant Singh Chawda \r\nVijay Singh Purohit, Amey Karwade, Akshat Sawerker for receiving placement offer from \r\nICICI Prudential during the Campus Drive \r\nheld at MIT Group. May this beginning leads you towards your desired destination', 'MIT Placement | ICICI Prudential', 'ImagePlacementNews/29d71da8-315e-4101-94ef-fee558c94ef2.jpg', 'Admin', '2019-01-15 00:00:00', 'MIT Placement | ICICI Prudential', 'MIT Placement, ICICI Prudential, MIT Ujjain', 'Congratulations!! Aanchal kakkar, Ayushi Bhardwaj, Abhishek Sharma, Sankalp Bairagi\r\nMohit Rathore, Kishkindha Patankar, Hemant Singh Chawda \r\nVijay Singh Purohit, Amey Karwade, Akshat Sawerker for receiving placement offer from \r\nICICI Prudential'),
